import React, { useEffect, useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "../styles/tereTulemast.css";
import { signOut } from "firebase/auth";
import { auth } from "../firebase-config";
import { Navbar, Container, NavDropdown } from "react-bootstrap";
import { useNavigate } from "react-router-dom";

const MyNavbar = (props) => {
  const [kasutaja, setKasutaja] = useState("");
  const navigate = useNavigate();

  useEffect(() => {
    auth.onAuthStateChanged((user) => {
      setKasutaja(user.email);
    });
    if (!kasutaja) {
      navigate("/");
    }
  }, []);

  const logiValja = () => {
    signOut(auth)
      .then(navigate("/"))
      .catch((err) => {
        alert(err.message);
      });
  };

  return (
    <div>
      <Navbar className="navi" sticky="top">
        <Container>
          <Navbar.Brand href="#">Eesmärk</Navbar.Brand>
          <Navbar.Collapse className="justify-content-end">
            <NavDropdown title={kasutaja}>
              <NavDropdown.Item href="#action3">Muuda andmeid</NavDropdown.Item>
              <NavDropdown.Item href="#action4">Statistika</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item onClick={logiValja}>
                Logi välja{" "}
              </NavDropdown.Item>
            </NavDropdown>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </div>
  );
};
export { MyNavbar };
